import React from 'react';
import PropTypes from 'prop-types';
import './navigation.css';

import { Link } from 'react-router-dom'

const componentClassName = 'navigation'

const Navigator = ({
  id,
  style,
  menu,
}) => {
  return (
    <nav
      id={id}
      style={style}
    >

    <div className="wrapper">
      <div className="menu">
        <ul>
          <li> hello</li>
        </ul>
      </div>
    </div>    

    </nav>
    )
}
